import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState([]);
  const [clickedLabelIndex, setClickedLabelIndex] = useState(null);
  const [showDoubleBarGraph, setShowDoubleBarGraph] = useState(true);

  useEffect(() => {
    Papa.parse('/static/data.csv', {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        const labelCounts = {};

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "white",
              backgroundColor: "#defde0"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values",
              color: 'white'
            }
          },
          scales: {
            x: {
              ticks: {
                color: 'white'
              }
            },
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count",
                color: 'white'
              },
              ticks: {
                color: 'white'
              }
            }
          }
        });
      }
    });
  }, []);

  const handleColumnClick = async (event, activeElements) => {
    if (activeElements.length > 0) {
      const labelIndex = activeElements[0].index;
      setClickedLabelIndex(labelIndex); // Update clicked label index

      const clickedLabel = chartData.labels[labelIndex];

      if (showDoubleBarGraph) {
        // Create a new chart for the label count from the 'prediction' column
        const predictionLabelCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (label === clickedLabel && prediction !== undefined) {
                  if (predictionLabelCounts[prediction]) {
                    predictionLabelCounts[prediction] += 1;
                  } else {
                    predictionLabelCounts[prediction] = 1;
                  }
                }
              });

              const labelCountChartData = {
                labels: Object.keys(predictionLabelCounts),
                datasets: [
                  {
                    label: "Count",
                    data: Object.values(predictionLabelCounts),
                    borderColor: "white",
                    backgroundColor: ["#ff4040", "#B6E4EB"]
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      } else {
        // Create a new chart for the count of each value of req2Product in the clicked column
        const req2ProductCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const req2Product = item['req2Product'];
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (label === clickedLabel && req2Product !== undefined && prediction !== undefined) {
                  if (!req2ProductCounts[req2Product]) {
                    req2ProductCounts[req2Product] = {};
                  }

                  if (req2ProductCounts[req2Product][prediction]) {
                    req2ProductCounts[req2Product][prediction] += 1;
                  } else {
                    req2ProductCounts[req2Product][prediction] = 1;
                  }
                }
              });

              const labelCountChartData = {
                labels: Object.keys(req2ProductCounts),
                datasets: [
                  {
                    label: "Prediction 0",
                    data: Object.values(req2ProductCounts).map((countObj) => countObj[0] || 0),
                    borderColor: "white",
                    backgroundColor: "#ff4040"
                  },
                  {
                    label: "Prediction 1",
                    data: Object.values(req2ProductCounts).map((countObj) => countObj[1] || 0),
                    borderColor: "white",
                    backgroundColor: "#B6E4EB"
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      }
    }
  };

  const toggleGraphType = () => {
    setShowDoubleBarGraph((prevValue) => !prevValue);
    setLabelCountData([]);
  };

  return (
    <div>
      <h1>req1Product Analysis</h1>
      <div style={{ display: 'flex' }}>
        <div style={{ flex: '0 0 50%' }}>
          <Bar data={chartData} options={chartOptions} getElementAtEvent={handleColumnClick} />
        </div>
        <div style={{ flex: '0 0 50%' }}>
          {clickedLabelIndex !== null && labelCountData[clickedLabelIndex] &&
            <Bar data={labelCountData[clickedLabelIndex].chartData} options={labelCountData[clickedLabelIndex].chartOptions} />
          }
        </div>
      </div>
      <div style={{ marginTop: '20px' }}>
        <button onClick={toggleGraphType}>{showDoubleBarGraph ? 'Show Single Bar Graph' : 'Show Double Bar Graph'}</button>
      </div>
    </div>
  );
}

export default Home;
